(49, 1, '2019-01-19 19:44:42', '2019-01-19 19:44:42', '<h2>\n					ALBAÑILERÍA\n				</h2>\n				<p>We love photography! Our passion is to capture the wedding</p>\n				<h2>\n					HERRERIA\n				</h2>\n				<p>We love photography! Our passion is to capture the wedding</p>\n				<h2>\n					CLIMA\n				</h2>\n				<p>We love photography! Our passion is to capture the wedding</p>\n			<a href=\"/servicios\" role=\"button\" id=\"other_services\">\n						Otros Servicios\n					</a>\n			<h2>Quiénes somos y Qué hacemos?</h2>		\n		<p>Somos un grupo proveniente del sector estatal con 30 años de experiencia, compuesto por ingenieros, técnicos y obreros calificados en todas las especialidades de la construcción.</p><p>Somos especialistas en construcción y mantenimiento de obras, cumpliendo con la legislación vigente para el trabajo por cuenta propia. Ofreciendo una preparación técnica con toda la información necesaria y auditáble en cualquier etapa de la ejecución</p>		\n			<h2>Nuestros Contratos Poseen</h2>		\n					<ul>\n							<li >\n										Presupuesto de obra\n									</li>\n								<li >\n										Cronograma de ejecución\n									</li>\n								<li >\n										Cronograma de suministro\n									</li>\n								<li >\n										Cartas límite\n									</li>\n								<li >\n										Plan de seguridad y salud del trabajo\n									</li>\n						</ul>\n					<ul>\n							<li >\n										Norma ISO 9001:2015\n									</li>\n								<li >\n										Libro de Obra\n									</li>\n								<li >\n										Registro de control de la documentación técnica\n									</li>\n								<li >\n										Registro de control de las licencias\n									</li>\n								<li >\n										Actas de trabajos ocultos\n									</li>\n								<li >\n										Actas de inicio y terminación de objetos de obra\n									</li>\n						</ul>\n		<p>También contamos con un software que permite al cliente comprobar el avance de la obra desde su PC</p>		\n			<h2>Obras</h2>		\n		[display-posts category=\"obra\" image_size=\"medium\" \nwrapper=\"div\" wrapper_class=\"display-posts-listing grid\"\nmeta_key=\"_thumbnail_id\"\nposts_per_page=\"3\"\n]		\n			<a href=\"/obras\" role=\"button\" id=\"other_builds\">\n						Otras Obras\n					</a>\n			<h2>Qué opinan nuestros clientes</h2>		\n		[display-posts \ncategory=\"comentario\"\ninclude_content=\"true\" \nwrapper=\"div\" \nwrapper_class=\"display-posts-listing comment row\"\nposts_per_page=\"2\"\n]		\n			<h2>Comentarios</h2>		\n		[contact-form-7 id=\"5\" title=\"Contact form 1\"]		\n			<h2>Contáctenos</h2>		\n			Tel: +53 51478426		\n			Email: dreyna@gmail.com		\n			Dir: Lorem ipsum		\n			<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=La%20Habana%2C%20Cuba&amp;t=m&amp;z=10&amp;output=embed&amp;iwloc=near\" aria-label=\"La Habana, Cuba\"></iframe>', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2019-02-11 03:15:13', '2019-02-11 03:15:13', '', 0, 'http://www.dreyna.com/?page_id=49', 0, 'page', '', 0),
