(144, 1, '2019-01-19 21:37:33', '2019-01-19 21:37:33', '<a href=\"/photography/\">\n				</a>\n				<h2>\n					<a href=\"/photography/\">Photography</a>\n				</h2>\n				<p>We love photography! Our passion is to capture the wedding</p>\n				<a href=\"/videography/\">\n				</a>\n				<h2>\n					<a href=\"/videography/\">Videography</a>\n				</h2>\n				<p>In the films we make, the quality should be amazing! But is should </p>\n				<a href=\"/webdesign/\">\n				</a>\n				<h2>\n					<a href=\"/webdesign/\">Webdesign</a>\n				</h2>\n				<p>It is important to be seen on the internet. You can have a great business but If people do not see </p>\n			<h2>Who We Are. What We Do</h2>		\n		<p>We are Ferdy and Anna. Married for 2 years and passionate for photography, videography and webdesign. We work as a team and combine our talents so we can be of a great service to you.</p>		\n			<a href=\"/about-us/\" role=\"button\">\n						More About Us\n					</a>\n			<h2>What People Say About Us</h2>		\n							Click edit button to change this text. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec ullamcorper mattis, pulvinar dapibus leo.\n							<img src=\"http://www.dreyna.com/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" />						\n													John Doe\n																			Designer\n							Click edit button to change this text. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec ullamcorper mattis, pulvinar dapibus leo.\n							<img src=\"http://www.dreyna.com/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" />						\n													John Doe\n																			Designer\n			<h2>Formulario</h2>		\n			<h2>Contacto</h2>', 'Home', '', 'inherit', 'closed', 'closed', '', '49-revision-v1', '', '', '2019-01-19 21:37:33', '2019-01-19 21:37:33', '', 49, 'http://www.dreyna.com/2019/01/19/49-revision-v1/', 0, 'revision', '', 0),
